from colorama import init, Fore, Style
import time
import sys

# Initialize Colorama
init(autoreset=True)

def Print_slow(srt):
    """Print text slowly, character by character."""
    for char in srt:
        sys.stdout.write(char)
        sys.stdout.flush()
        time.sleep(0.2)

